import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import EmergencyView from './EmergencyView';
import './index.css';

const Root = () => {
  try {
    return <App />;
  } catch (error) {
    console.error('App failed to render:', error);
    return <EmergencyView />;
  }
};

ReactDOM.render(
  <React.StrictMode>
    <Root />
  </React.StrictMode>,
  document.getElementById('root')
);
